        _name = name_;
        _symbol = symbol_;
        _decimal = decimal_;
        _mint(_msgSender(), totalSupply_);
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            UNISWAPV2ROUTER
